import React, { Component } from "react";
// import { render } from "@testing-library/react";

class Innercomponents extends Component {

    state = {
          cars: ["Tesla","tata","audi" ],
          coupe: ["abcd","efgh","ijkl"]

        };

        selectvalue = ()=>{
            const {cars, coupe}=this.state;
            if(this.props.filteredValue == "cars"){
                return coupe.map((coup,index) => { return <div key={`${index}_filter`}> {coup}  </div> });
            }
        }

    render(){
        console.log(this.props.filteredValue+" Innercomponentss");
        const {cars, coupe}=this.state;
        return(
            <div className="card">
                <div  className="card-body">
             {this.props.filteredValue == "coupe" &&
                
                coupe.map((coup,index) => { return <div key={`${index}_filter`}> {coup}  </div> })
                }
                {
                 this.props.filteredValue == "cars" &&
                
                 cars.map((car,index) => { return <div key={`${index}_filter`}> {car}  </div> })
                    
                }
                </div>
            </div>

        );
    }


} 
export default Innercomponents
